import React from "react";
import styles from "./Dialogs.module.css"
import {NavLink} from "react-router-dom";



const DialogItem = (proms) => {
    return (
        <div className={styles.dialog}>
            <NavLink to={'/dialogs/' + proms.number}>{proms.name}</NavLink>
        </div>
    )
}

const Message = (proms) => {
    return (
        <div className={styles.message}>{proms.message}</div>
    )
}




const Dialogs = (proms) => {

    const dialogData = [
        {id: 1, name: "Alex"},
        {id: 2, name: "Petya"},
        {id: 3, name: "Petya"},
        {id: 4, name: "Vanya"},
        {id: 5, name: "Petya"},
        {id: 6, name: "Tanya"}
    ]

    return (
        <div className={styles.dialogs}>
            <div className={styles.dialogsItem}>
                <DialogItem name={dialogData[0].name} id={dialogData[0].id}/>
                <DialogItem name={dialogData[1].name} id={dialogData[1].id}/>
                <DialogItem name={dialogData[2].name} id={dialogData[2].id}/>
                <DialogItem name={dialogData[3].name} id={dialogData[3].id}/>
                <DialogItem name={dialogData[4].name} id={dialogData[4].id}/>
                <DialogItem name={dialogData[5].name} id={dialogData[5].id}/>
                <DialogItem name={dialogData[6].name} id={dialogData[6].id}/>
            </div>
            <div className={styles.messages}>
                <Message message="Hello"/>
                <Message message="No"/>
                <Message message="Yes"/>
                <Message message="Yes"/>
                <Message message="No"/>
                <Message message="No"/>
            </div>
        </div>
    )
}

export default Dialogs;
